import {Container, Content} from "./style"
const Catalogo = () => {
  return (
    <Container>
      <Content >
        <li>Catalogo</li>
        <li>Formatura</li>
        <h1>Frontier Drinks</h1>
        <li>Casamento</li>
        <li>Confraternização</li>
      </Content>
    </Container>
  );
};
export default Catalogo;
